import React from "react";
import "./Card.scss";
import { Link } from "react-router-dom";

const Card = ({ item }) => {
	return (
		<Link to={`/product/${item.id}`}>
			<div className="Card">
				<div className="image">
					<img src={item.img} alt="" className="mainImg" />
					<img src={item.img2} alt="" className="secondImg" />
				</div>
				<h2>{item.title}</h2>
				<div className="prices">
					<h3>item.oldPrice</h3>
				</div>
			</div>
		</Link>
	);
};

export default Card;
